import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './PredictionsPage.css';

const PredictionsPage = () => {
  const [predictions, setPredictions] = useState([]);
  const teamLogos = {
    "New York Mets": require("../images/mets.png").default,
    "New York Yankees": require("../images/yankees.png").default,
    "Baltimore Orioles": require("../images/orioles.png").default,
    "Boston Red Sox": require("../images/redsox.png").default,
    "Tampa Bay Rays": require("../images/rays.png").default,
    "Toronto Blue Jays": require("../images/bluejays.png").default,
    "Atlanta Braves": require("../images/braves.png").default,
    "Philadelphia Phillies": require("../images/phillies.png").default,
    "Miami Marlins": require("../images/marlins.png").default,
    "Washington Nationals": require("../images/nationals.png").default,
    "Cleveland Guardians": require("../images/guardians.png").default,
    "Pittsburgh Pirates": require("../images/pirates.png").default,
    "Detroit Tigers": require("../images/tigers.png").default,
    "Milwaukee Brewers": require("../images/brewers.png").default,
    "St. Louis Cardinals": require("../images/cardinals.png").default,
    "Chicago White Sox": require("../images/whitesox.png").default,
    "Chicago Cubs": require("../images/cubs.png").default,
    "Kansas City Royals": require("../images/royals.png").default,
    "Minnesota Twins": require("../images/twins.png").default,
    "Texas Rangers": require("../images/rangers.png").default,
    "Cincinnati Reds": require("../images/reds.png").default,
    "Los Angeles Angels": require("../images/angels.png").default,
    "San Diego Padres": require("../images/padres.png").default,
    "Los Angeles Dodgers": require("../images/dodgers.png").default,
    "Oakland Athletics": require("../images/athletics.png").default,
    "Seattle Mariners": require("../images/mariners.png").default,
    "Houston Astros": require("../images/astros.png").default,
    "Colorado Rockies": require("../images/rockies.png").default,
    "Arizona Diamondbacks": require("../images/diamondbacks.png").default,
    "San Francisco Giants": require("../images/giants.png").default
  };


  useEffect(() => {
    const fetchPredictions = async () => {
      try {
        const response = await axios.get('http://localhost:8000/games');
        console.log(response.data);
        setPredictions(response.data);
      } catch (error) {
        console.error(error);
      }
    };

    fetchPredictions();
  }, []);

  const convertToEST = (gameTime) => {
    const [hours, minutes] = gameTime.split(':');
    const estTime = new Date();
    estTime.setUTCHours(hours);
    estTime.setUTCMinutes(minutes);

    const options = { timeZone: 'America/New_York', hour12: true, hour: 'numeric', minute: 'numeric' };
    return estTime.toLocaleString('en-US', options);
  };

  return (
    <div className="predictions-page">
      <div className="predictions-title-wrapper">
        <h1 className="predictions-title">MLB Game Predictions</h1>
      </div>
      {predictions.map((data) => (
        <div key={data.mlbGame.gameId} className="prediction-item">
          <div className="team-info">
            <div className="away-team">
              <img src={teamLogos[data.mlbGame.awayTeamName]} alt="Away Team Logo" className="team-logo" />
              <p>{data.mlbGame.awayTeamName}</p>
              <p>{data.mlbGame.awayTeamScore}</p>
            </div>
            <div className="home-team">
              <img src={teamLogos[data.mlbGame.homeTeamName]} alt="Home Team Logo" className="team-logo" />
              <p>{data.mlbGame.homeTeamName}</p>
              <p>{data.mlbGame.homeTeamScore}</p>
            </div>
          </div>
          {data.mlbGame.isWinnerHome || data.mlbGame.isWinnerAway ? <p className="game-status">Final</p> : null}
          <p className="game-time">{convertToEST(data.mlbGame.gameTime)}</p>
          <p className="prediction">Prediction: {data.prediction?.prediction}</p>
        </div>
      ))}
    </div>
  );
};

export default PredictionsPage;
